import React, { Component } from 'react';
import {Link, Router} from 'react-router-dom';
import { NavLink as RRNavLink } from 'react-router-dom';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem } from 'reactstrap';
import Cookies from 'js-cookie';
import {connect} from "react-redux";
import {logoutUserAction} from '../actions/authenticationActions';
//import SideBar from "../index";
import SideBar from './sidebar/SideBar';
import Content from './content/Content';
import '../App.css';

class MoviePage extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isOpen: true
        };

    }

    toggle = () => {
        this.setState({isOpen: !this.state.isOpen});
    };


    render() {
        return (
            <div>
                <SideBar toggle={this.toggle} isOpen={this.state.isOpen}/>
                <Content toggle={this.toggle} isOpen={this.state.isOpen}/>
                <Navbar color="light" light expand="md">
                    <NavbarBrand href="/">BnB_Cleanings</NavbarBrand>
                    <NavbarToggler  />
                    <Collapse isOpen={this.state.isOpen} navbar>
                        <Nav className="ml-auto" navbar>



                                        <NavItem>
                                            <NavLink tag={RRNavLink} exact to="/properties" activeClassName="active">Properties </NavLink>
                                        </NavItem>
                                        <NavItem>
                                            <NavLink tag={RRNavLink} exact to="/property/create" activeClassName="active">New Property</NavLink>
                                        </NavItem>
                                        <NavItem>
                                            <NavLink tag={RRNavLink} exact to="/#" activeClassName="active" onClick={this.logout}>Cleaners</NavLink>
                                        </NavItem>
                                        <NavItem>
                                            <NavLink tag={RRNavLink} exact to="/#" activeClassName="active" onClick={this.logout}>Today's Cleanings</NavLink>
                                        </NavItem>

                                        <NavItem>
                                            <NavLink tag={RRNavLink}  to="/login" activeClassName="active">Login</NavLink>
                                        </NavItem>
                                        <NavItem>
                                            <NavLink tag={RRNavLink} exact to="/register" activeClassName="active">Register</NavLink>
                                        </NavItem>



                        </Nav>
                    </Collapse>
                </Navbar>
            </div>
        );
    }
}

const mapStateToProps = (state) => ({state});

export default connect(mapStateToProps)(MoviePage);
